import React from 'react'; 
import Card from 'react-bootstrap/Card';
import ListGroup from 'react-bootstrap/ListGroup';
import '../Components/About.css';

function About() {
  return (
    <div className="aboutMePage">
      <br></br>

      <h1 className='bigtext'> About Me </h1>

      <Card style={{ width: '25rem' }}>
        <Card.Img variant="top" src="holder.js/100px180?text=Image cap" />
          <Card.Body>
            <Card.Title> Get to know me! </Card.Title>
            <Card.Text>
            My name is David Anderson and I am living in the Minneapolis, MN area. 
            In my free time I enjoy spending time with friends, writing music, and coding!
            </Card.Text>
          </Card.Body>
        <ListGroup className="list-group-flush">

          <ListGroup.Item> Cell: (320)-262-0320 </ListGroup.Item>
          <ListGroup.Item> Email: david.anderson1993@gmail.com </ListGroup.Item>

        </ListGroup>
        <Card.Body>
          <Card.Link onClick={()=> window.open("https://www.linkedin.com/in/david-anderson-35701115b/", "_blank")}>
            Link
          </Card.Link>
          <Card.Link href="#">Another Link</Card.Link>
        </Card.Body>
      </Card>

    </div>
  );
}

export default About;
